import React, { Component } from 'react';
import Tableinputs from './components/tableinput';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state = {
    planos: [
      {
        title: 'FaleMais 30',
        category: 'form 30'
      },
      {
        title: 'FaleMais 60',
        category: 'form 60'
      },
      {
        title: 'FaleMais 120',
        category: 'form 120'
      },
    ]
  }
}
  render() {
    return (
      <div className="App">
        xera meu sacoo
        <Planos planos={this.state.planos} />
      </div>
    );
  }
}

export default App;
